// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;
pragma abicoder v2;

contract Voting {
    struct Voter {
        string id;
        uint256 area;
        bool canVote;
        bool votedForCandidate;
        bool votedForParty;
    }

    struct Party {
        string name;
        uint256 voteCount;
    }

    struct Candidate {
        uint256 id;
        string name;
        string party;
        uint256 area;
        uint256 voteCount;
    }

    enum VOTING_STATE {
        OPEN,
        CLOSED
    }

    VOTING_STATE public voting_state;

    address public chairperson;
    mapping(address => Voter) public voters;

    Candidate[] public candidates;
    Party[] public parties;
    uint256 public party_vote_count=0;
    uint256 public candidate_vote_count=0;
    uint256 public voter_count = 0;





    constructor(
        string[4][] memory candidateNamesParty,
        string[] memory partyNames
    ) payable {
        chairperson = msg.sender;
        voters[chairperson].canVote = true;
        for (uint256 i = 0; i < candidateNamesParty.length; i++) {
            uint area = stringToUint(candidateNamesParty[i][3]);
            uint id = stringToUint(candidateNamesParty[i][0]);

            candidates.push(
                Candidate({
                    id: id,
                    name: candidateNamesParty[i][1],
                    party: candidateNamesParty[i][2],
                    area: area,
                    voteCount: 0
                })
            );
        }
        for (uint256 i = 0; i < partyNames.length; i++) {
            parties.push(Party({name: partyNames[i], voteCount: 0}));
        }
        voter_count += 1;
    }

    modifier onlyOwner() {
        require(msg.sender == chairperson, "only owner can use this");
        _;
    }

    function stringToUint(string memory numString)
        public
        pure
        returns (uint256)
    {
        uint256 val = 0;
        bytes memory stringBytes = bytes(numString);
        for (uint256 i = 0; i < stringBytes.length; i++) {
            uint256 exp = stringBytes.length - i;
            bytes1 ival = stringBytes[i];
            uint8 uval = uint8(ival);
            uint256 jval = uval - uint256(0x30);

            val += (uint256(jval) * (10**(exp - 1)));
        }
        return val;
    }


    function getCandidates(uint area)public view returns(Candidate[] memory) {
        uint totalCandidates = candidates.length;
        require(totalCandidates > 0, "No candidates registered");

        uint numCandidatesOnArea;
        for (uint256 i = 0; i < totalCandidates; i++) {
            if(candidates[i].area == area){
                numCandidatesOnArea +=1;
            }
        }
        require(numCandidatesOnArea > 0, "No candidates found");
        uint x =0;
        // string[] memory candidates_to_return = new string[](numCandidatesOnArea);
        Candidate[] memory candidates_to_return = new Candidate[](numCandidatesOnArea);
        for (uint256 i = 0; i < totalCandidates; i++) {
            if(candidates[i].area == area){
                candidates_to_return[x] = candidates[i];
                x+=1;
            }
        }

        return candidates_to_return;
    }
    // function getCandidates(uint256 area) public view returns (Candidate[] memory temp ) {
    //     uint x = 0;
    //     for (uint256 i=0; i<candidates.length; i++){
    //         if (candidates[i].area == area) {
    //             temp[x] = candidates[i];
    //             x+=1;
    //         }
    //     }
    // }

    function getParties() public view returns (Party[] memory) {
        return parties;
    }

    function giveRightToVote(
        address payable voter,
        string memory id,
        string memory area

    )onlyOwner external {

        require(
            !voters[voter].votedForCandidate || !voters[voter].votedForParty,
            "The voter already voted"
        );
        require(!voters[voter].canVote, "Voter can already vote");
        voters[voter].canVote = true;
        voters[voter].id = id;
        voters[voter].area = stringToUint(area);
        voters[voter].votedForCandidate = false;
        voters[voter].votedForParty = false;
        voter.transfer(1000000000000000);
        voter_count += 1;
    }

    function removeRightToVote(address voter) onlyOwner external {

        require(
            !voters[voter].votedForCandidate || !voters[voter].votedForParty,
            "The voter already voted"
        );
        require(voters[voter].canVote, "Voter doesn't have right to vote");
        voters[voter].canVote = false;
        voter_count -= 1;
    }

    function voteCandidate(uint256 candidateId) external {
        Voter storage sender = voters[msg.sender];
        uint id;
        require(sender.canVote, "Has no right to vote");
        require(!sender.votedForCandidate, "already voted for candidate");
        for (uint256 i=0; i<candidates.length; i++){
            if (candidates[i].id == candidateId) {
                id = i;
                break;
            }
        }
        require(
            sender.area == candidates[id].area,
            "cannot vote candidate in this area"
        );
        candidates[id].voteCount += 1;
        candidate_vote_count +=1;
        sender.votedForCandidate = true;
    }

    function voteParty(uint256 party) external {
        Voter storage sender = voters[msg.sender];
        require(sender.canVote, "Has no right to vote");
        require(!sender.votedForParty, "already voted for party");
        parties[party].voteCount += 1;
        party_vote_count += 1;
        sender.votedForCandidate = true;
    }

    function winningCandidate(uint256 area) public view returns (Candidate memory winningCandidate_){
        Candidate[] memory candidates_in_area = getCandidates(area);
        uint256 winningVoteCount = 0;
        winningCandidate_ = candidates_in_area[0];
        for (uint256 i = 0; i < candidates_in_area.length; i++) {
            if (candidates_in_area[i].voteCount > winningVoteCount) {
                winningVoteCount = candidates_in_area[i].voteCount;
                winningCandidate_ = candidates_in_area[i];
            }
        }
    }

    function winningParty() public view returns (Party memory  winningParty_) {
        uint256 winningVoteCount = 0;
        winningParty_ = parties[0];
        for (uint256 i = 0; i < parties.length; i++) {
            if (parties[i].voteCount > winningVoteCount) {
                winningVoteCount = parties[i].voteCount;
                winningParty_ = parties[i];
            }
        }
    }

    function fund() public payable {}

    function get_balance() public view returns (uint256) {
        return address(this).balance;
    }

    function startElection() public onlyOwner {
        require(
            voting_state == VOTING_STATE.CLOSED,
            "Can't start a new lottery yet!"
        );
        voting_state = VOTING_STATE.OPEN;
    }

    function is_open() public view returns(bool state){
        if (voting_state == VOTING_STATE.OPEN) {
            return true;
        }
        else{
            return false;
        }
    }

}
